import React, { useState } from "react";
import "./Style/Books.css";
const Books = () => {
  let [book, setBook] = useState([]);
  let fetchApi = async () => {
    let apiData = await fetch("http://localhost:4000/books").then((res) =>
      res.json()
    );
    setBook(apiData);
  };
  fetchApi();

  // console.log(book.data)
  return (
    <>
      <div className="books">
        {book.map((elem) => {
          let {
            id,
            title,
            isbn,
            pageCount,
            publishedDate,
            thumbnailUrl,
            longDescription,
            status,
            authors,
            categories,
          } = elem;

          return (
            <>
           <>
              <div className="card ">
                <div className="name ">Id - {id}</div>
                <div className="image">
                  <img src={image} alt="Image is Not Yet" />
                </div>
                <div className="year">Prics - {price}</div>
              </div>
            </>
            </>
          );
        })}
      </div>
    </>
  );
};

export default Books;
